    true,nt"url": null,nt"notes": "The San Emidio geothermal system is characterized
    by a left-step in a west-dipping normal fault system that bounds the western side
    of the Lake Range. The 3D geologic model consists of 5 geologic units and 55 faults.
    Overlying Jurrassic-Triassic metasedimentary basement is a ~500 m-1000 m thick section
    of the Miocene lower Pyramid sequence, pre- syn-extensional Quaternary sedimentary
    rocks and post-extensional Quaternary rocks. 15-30u00ba eastward dip of the stratigraphy
    is controlled by the predominant west-dipping fault set. Both geothermal production
    and injection are concentrated north of the step over in an area of closely spaced
    west dipping normal faults.",nt"license_title": "Creative Commons Attribution",nt"extras":
